import React from "react";
import { Card } from "react-bootstrap";

const Submission = ({ values }) => {
  const { firstName, lastName, email, vehicleSelect, maxPrice } = values;
  return (
    <>
      <p>First Name: {firstName}</p>
      <p>First Name: {firstName}</p>
      <p>First Name: {firstName}</p>
      <p>First Name: {firstName}</p>
      <p>First Name: {firstName}</p>
    </>
  );
};

export default Submission;
